import pydicom as dicom
from PIL import Image
import os
import cv2
import numpy as np
import matplotlib.pyplot as plt
import sys
from scipy.signal import find_peaks

np.set_printoptions(threshold=sys.maxsize)


class DICOMReader:
    """
    This class reads a DICOM file and extract all it's images to a folder.
    All images are extracted without compression and in the TIFF format.
    """

    # those coordinates correspond to the sub rectangle containing only the interesting part of the ultra sound image
    x1 = [120, 90]
    X2 = [120, 495]
    X3 = [800, 495]
    X4 = [800, 90]
    xmin = 120
    xmax = 800
    ymin = 90
    ymax = 495

    def __init__(self, image_filename, DEBUG=False):
        """
        Read the DICOM file, store the number of image and it's size
        :param image_filename: path of the dicom file
        """
        self.image_path = image_filename
        self.path, self.filename = os.path.split(self.image_path)
        self.DEBUG = DEBUG

        if self.DEBUG:
            print('path:', self.path, 'filename:', self.filename)

        self.ds = dicom.dcmread(self.image_path)
        self.nb_images, self.height, self.width = self.ds.pixel_array.shape

    def get_dicom_details(self):
        if self.DEBUG:
            print(self.nb_images, "images", "height", self.height, "width", self.width)

        return self.nb_images, self.height, self.width

    def extract_images_pillow(self):
        """
        Extract images inside the dicom file to a folder using PILLOW
        """
        # create a folder
        if not os.path.isdir(self.filename + "_images"):
            os.mkdir(self.filename + "_images")

        for img_index in range(self.nb_images):
            # L (8-bit pixels, black and white)
            img = Image.fromarray(self.ds.pixel_array[img_index], mode='P')

            temp_img_path = os.path.join(self.filename + "_images", self.filename + '_' + str(img_index) + '.tiff')

            img.save(temp_img_path, format='tiff', compression="raw")
            print(img.histogram())
            plt.plot(img.histogram())
            plt.show()
            # img.show()

        if self.DEBUG:
            print(self.nb_images, 'images saved to', self.filename + "_images")

    def extract_images_opencv(self, save_to_file=False):
        """
        Extract images inside the dicom file to a folder using OPENCV
        :param save_to_file:
        :return:
        """
        # create a folder
        if not os.path.isdir(self.filename + "_images"):
            os.mkdir(self.filename + "_images")

        for img_index in range(self.nb_images):
            temp_img_path = os.path.join(self.filename + "_images", self.filename + '_' + str(img_index) + '.tiff')
            cropped_image = self.ds.pixel_array[img_index][self.ymin:self.ymax, self.xmin:self.xmax + self.xmin]

            if save_to_file:
                cv2.imwrite(temp_img_path, cropped_image, [cv2.IMWRITE_TIFF_COMPRESSION, 1])

        if self.DEBUG:
            print(self.nb_images, 'images saved to', self.filename + "_images")

        # TODO return np array of cropped images

    def extract_images_opencv_dev(self, save_to_file=False):
        """
        Extract images inside the dicom file to a folder using OPENCV
        :param save_to_file:
        :return:
        """

        array_image = []

        # create a folder
        if not os.path.isdir(self.filename + "_images") and save_to_file:
            os.mkdir(self.filename + "_images")

        for img_index in range(self.nb_images):
            temp_img_path = os.path.join(self.filename + "_images", self.filename + '_' + str(img_index) + '.tiff')
            cropped_image = self.ds.pixel_array[img_index][200:500, 370:700]
            array_image.append(cropped_image)

            if save_to_file:
                cv2.imwrite(temp_img_path, cropped_image, [cv2.IMWRITE_TIFF_COMPRESSION, 1])

        if self.DEBUG:
            print(self.nb_images, 'images saved to', self.filename + "_images")

        return array_image

    def get_images_array(self, save_to_file=False):
        """
        Extract images inside the dicom file to a folder using OPENCV
        :param save_to_file:
        :return:
        """

        return self.ds.pixel_array

    def show_max_contours(self):
        """
        This function try to find the biggest area contour inside the ultra sound image to get only the fan shape.
        """

        for img_index in range(5, self.nb_images):
            cropped_image = self.ds.pixel_array[img_index][self.ymin:self.ymax, self.xmin:self.xmax + self.xmin]

            ret, thresh = cv2.threshold(cropped_image, 25, 255, 0)
            contours, hierarchy = cv2.findContours(thresh, cv2.RETR_EXTERNAL, cv2.CHAIN_APPROX_NONE)

            contours_area = []
            for contour in contours:
                perimeter = cv2.arcLength(contour, True)
                contours_area.append(perimeter)

            max_perimeter_contours_index = contours_area.index(max(contours_area))

            print(contours[max_perimeter_contours_index])
            print(type(contours[max_perimeter_contours_index]))
            print(contours[max_perimeter_contours_index].tobytes())
            print(contours[max_perimeter_contours_index].shape)
            print(contours[max_perimeter_contours_index].dtype.name)

            # inverse black and white
            img_row_sum = np.sum(255 - cropped_image, axis=0).tolist()

            # draw histogramm and image
            f, axarr = plt.subplots(2)
            f.suptitle(self.filename + '_' + str(img_index) + '.tiff', fontsize=20)

            axarr[0].plot(img_row_sum)

            # draw max area contour found onto the image
            cv2.drawContours(cropped_image, contours, max_perimeter_contours_index, (255, 0, 0), 2)

            axarr[1].imshow(cropped_image, cmap=plt.cm.gray)
            axarr[1].axis('off')

            plt.show()

    def show_histogram_white_rectangles(self):
        """
        This function display the color histogram of the ultra sound image.
        It also try to add white rectangle around the fan shape to smooth the histogram.
        """

        for img_index in range(self.nb_images):
            cropped_image = self.ds.pixel_array[img_index][self.ymin:self.ymax, self.xmin:self.xmax + self.xmin]

            # add white rectangles in corners to get accurate histogram
            cropped_image[0:110, 0:120] = 255  # top left
            cropped_image[0:89, 539:680] = 255  # top right
            cropped_image[110:217, 0:55] = 255  # second top left
            cropped_image[85:150, 581:680] = 255  # second top right
            cropped_image[350:405, 0:90] = 255  # bottom left
            cropped_image[350:405, 585:680] = 255  # bottom right
            cropped_image[0:20, 251:423] = 255  # top middle
            cropped_image[150:190, 612:680] = 255  # third top right
            cropped_image[0:60, 117:160] = 255
            cropped_image[0:40, 500:540] = 255

            # cv2.imshow(cropped_image)

            # inverse black and white
            img_row_sum = np.sum(255 - cropped_image, axis=0).tolist()

            # draw histogramm and image
            f, axarr = plt.subplots(2)
            f.suptitle(self.filename + '_' + str(img_index) + '.tiff', fontsize=20)

            axarr[0].plot(img_row_sum)

            axarr[1].imshow(cropped_image, cmap=plt.cm.gray)
            axarr[1].axis('off')

            plt.show()

    def show_histogram_perfect_contour(self):
        """
        This function display the color histogram of the ultra sound image and the local maxima to determine where
        the zone of interest is.
        It uses the perfect polygon contour to remove the black pixel around the fan shape image.
        """
        for img_index in range(105, self.nb_images):
            cropped_image = self.ds.pixel_array[img_index][self.ymin:self.ymax, self.xmin:self.xmax + self.xmin]

            contour = self.get_perfect_contour_array()

            h, w = cropped_image.shape

            # remove black pixel outside of contour
            for ix, iy in np.ndindex(cropped_image.shape):
                # -1 means outside of contour
                if cv2.pointPolygonTest(contour, (iy, ix), False) == -1:
                    cropped_image[ix, iy] = 255

            # inverse black and white and sum of pixel for histogram
            img_row_sum = np.sum(255 - cropped_image, axis=0).tolist()

            # play with brightness and contrast
            # cropped_image = self.set_brightness_contrast(cropped_image, contrast=1, brightness=25)

            # find local maxima
            peaks, _ = find_peaks(img_row_sum, distance=150, width=25)
            print("local maxima found :", peaks)

            # draw maximum on to LUS image
            for peak in peaks:
                cv2.line(cropped_image, (peak, 0), (peak, h), 255, 1, cv2.LINE_AA)

            # cv2.line(cropped_image, (max_left, 0), (max_left, h), 255, 1, cv2.LINE_AA)
            # cv2.line(cropped_image, (max_right, 0), (max_right, h), 255, 1, cv2.LINE_AA)

            # show histogram and image
            f, axarr = plt.subplots(2, figsize=(10, 8))
            f.suptitle(self.filename + '_' + str(img_index) + '.tiff', fontsize=20)

            axarr[0].plot(img_row_sum)
            # axarr[0].plot(peaks, np.array(img_row_sum)[peaks], "x")

            axarr[1].imshow(cropped_image, cmap=plt.cm.gray)
            axarr[1].axis('off')

            plt.show()

    def set_brightness_contrast(self, image, contrast, brightness):
        # Contrast control (1.0-3.0)
        # Brightness control (0-100)

        return cv2.convertScaleAbs(image, alpha=contrast, beta=brightness)

